import React from "react";

export const Button = (props) => {
  return (
    <div
      onClick={props.onPress}
      style={{
        cursor: "pointer",
        height: 40,
        width: 130,
        border: `1px solid ${props.color}`,
        backgroundColor: props.type ? props.color : "white",
        color: props.type ? "white" : props.color,
        textAlign: "center",
        justifyContent: "center",
        fontSize: 18,
        paddingTop: 5,
        borderRadius: 5,
        marginTop: 10,
        marginLeft: 20,
        marginRight: 20,
      }}
    >
      {props.text}
    </div>
  );
};
export const LargeButton = (props) => {
  return (
    <div
      onClick={props.onPress}
      style={{
        cursor: "pointer",
        marginTop: 20,
        height: 50,
        width: 250,
        opacity: 0.6,
        backgroundColor: props.type ? props.color : "white",
        color: props.type ? "white" : props.color,
        textAlign: "center",
        justifyContent: "center",
        fontSize: 18,
        paddingTop: 10,
        borderRadius: 5,
        border: `1px solid ${props.color}`,
        fontWeight: props.type && "bold",
      }}
    >
      {props.text}
    </div>
  );
};
export default Button;
